 ('88', '89', 'en_us', 'Five Pieces for Piano I', NULL, NULL, '<p>\r\n	  Every piece has unique atmosphere.\r\n</p>\r\n<p>\r\n	  I\r\n</p>\r\n<p>\r\n	  Sounds of steps spreading in hospital\'s air, with the medical machines\' beeping, something is hidden.\r\n</p>\r\n<p>\r\n	  II\r\n</p>\r\n<p>\r\n	  Carousel music box plays some neurotic song.\r\n</p>\r\n<p>\r\n	  III\r\n</p>\r\n<p>\r\n	  Low moan releases the concealed pain and anger of a lost soul.\r\n</p>\r\n<p>\r\n	  IV\r\n</p>\r\n<p>\r\n	  The transparent and magical blue bird is unpredictable and uncatchable.\r\n</p>\r\n<p>\r\n	  V\r\n</p>\r\n<p>\r\n	  Repeat the mechanized motion once again and again.\r\n</p>', '[{\"col1\":\"piano\"}]', '2:10', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"piano\",\"col2\":\"Ye-ren Lo\"}]', '', 'audio', '2002', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-26 19:04:16', '2017-03-11 19:02:51', '04a07954-c8bd-419e-8bb5-6a7249bb044a'),
