 ('183', '184', 'en_us', 'In THE Love', NULL, NULL, '<p>\r\n	Love is not to die for, not to possess, but to let it be. No matter in love or losing one, you should set the other free.</p>', '[{\"col1\":\"violin\"},{\"col1\":\"cello\"},{\"col1\":\"piano\"}]', '6:44', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"cello\",\"col2\":\"Song Zhao\"},{\"col1\":\"piano\",\"col2\":\"Jia Lin Zhang\"}]', '', 'audio', '2011', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-26 22:02:55', '2017-03-11 19:02:54', 'e1175d1a-7a7c-4916-8753-bb6bfb9e2b0d'),
