 ('191', '192', 'en_us', 'Immaculate Snow', NULL, NULL, '<p>\r\n	The title in Chinese means \"the lean air and light after thunderstorm or snowstorm.\" Deeper meaning is about being calm in this material world.</p><p>\r\n	I was inspired by the last snow in Beijing. It snowed heavily. The snow\'s crystal was very light and large, so it looks like feather. I was standing in front of a huge glass. The snow was so light so it flowed in the air sometimes up towards the sky. I felt like that I was in a glass snow ball. The snow leaned up the city and covered every noise. The world was full of tranquility.</p>', '[{\"col1\":\"string quartet\"}]', '7:23', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Can Gao and YaJing Su\"},{\"col1\":\"viola\",\"col2\":\"WenTing Kang\"},{\"col1\":\"cello\",\"col2\":\"YiChen Yang\"}]', '', 'audio', '2004', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 13:55:59', '2017-03-11 19:02:54', 'b154de59-eed4-459a-b974-bc7aa66ddc03'),
