 ('203', '204', 'en_us', 'Mvt. II, Recitative', NULL, NULL, '<p>\r\n	 In the dark and empty theater, after taking off the oil cosmetics and mask for the character in Chinese opera, a person sits there; aspirates; breath and hum.\r\n</p>', '[{\"col1\":\"string quartet\"}]', '4:52', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"vioin\",\"col2\":\"Pei-yun Hsiao and Kai-si Fan\"},{\"col1\":\"viola\",\"col2\":\"Jun-Yan Lai\"},{\"col1\":\"cello\",\"col2\":\"Peng-yun Hsu\"}]', '', 'audio', '2006', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:04:17', '2017-03-11 19:02:54', '5e63129e-094e-4cd0-947b-ad01b5e79e54'),
