 ('207', '208', 'en_us', 'Ink Painting', NULL, NULL, '<p>\r\n	Each single instrument of the quartet represents a basic nature element. first violin is the fire of war (fire), second violin is the wind in forest (wind), viola is the deep ocean (water), and cello is the shifting sands of desert (earth).\r\n</p>', '[{\"col1\":\"string quartet\"},{\"col1\":\"orchestra\"}]', '14:32', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Mark Gibson\"},{\"col1\":\"violin\",\"col2\":\"Gao Can and Kuan Chang Tu\"},{\"col1\":\"viola\",\"col2\":\"Yan-ting Wu\"},{\"col1\":\"cello\",\"col2\":\"Chang Pan\"}]', '', 'audio', '2011', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:10:22', '2017-03-11 19:02:54', '154d5758-5337-4c42-bf2b-360e603a3cbc'),
