 ('211', '212', 'en_us', 'Tinkly Jade', NULL, NULL, '<p>\r\n	In an empty palace that is so quiet, even the tinkling sound of jade hung on concubine\'s belt can be heard easily.\r\n</p>', '[{\"col1\":\"marimba\"},{\"col1\":\"string quartet\"}]', '10:19', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"marimba\",\"col2\":\"Bingye Chen\"},{\"col1\":\"string orchestra\",\"col2\":\"EOS orchestra\"}]', '', 'audio', '2007', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:14:17', '2017-03-11 19:02:54', '62e68028-e9ca-408b-836c-90cfd8495693'),
