 ('223', '224', 'en_us', 'Long-lived Buddhism Goddess Sutra', NULL, NULL, '<p>\r\n	Buddhism Goddess\r\n</p>\r\n<p>\r\n	Buddha\r\n</p>\r\n<p>\r\n	Affinity with Her\r\n</p>\r\n<p>\r\n	Karma with Her\r\n</p>\r\n<p>\r\n	Dharma and phase as one\r\n</p>\r\n<p>\r\n	Happiness with me\r\n</p>\r\n<p>\r\n	In the morning read Her name\r\n</p>\r\n<p>\r\n	In the twilight think of Her\r\n</p>\r\n<p>\r\n	Thoughts from heart\r\n</p>\r\n<p>\r\n	Thoughts with heart\r\n</p>', '[{\"col1\":\"soprano\"},{\"col1\":\"mixed choir\"},{\"col1\":\"harp\"},{\"col1\":\"string orchestra\"}]', '3:39', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jun-Chiang Chiu\"},{\"col1\":\"orchestra\",\"col2\":\"Taipei Philharmonics\"}]', '', 'audio', '2007', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 14:24:57', '2017-03-11 19:02:54', 'c5de1192-27d7-4c7c-badf-a5a96dd9d6a8');
