 ('264', '265', 'en_us', 'Resounding Silence', NULL, NULL, '<p>\r\n	 Yeki bout; yeki nabout. There was someone; there was no one. The long note at the beginning is realization of room tone. Everything happens later are heart beat and fantasy followed by severe headache.\r\n</p>', '[{\"col1\":\"flute\"},{\"col1\":\"clarinet\"},{\"col1\":\"bassoon\"},{\"col1\":\"horn\"},{\"col1\":\"trombone\"},{\"col1\":\"2 percussions\"},{\"col1\":\"piano\"},{\"col1\":\"2 violins\"},{\"col1\":\"violoncello\"},{\"col1\":\"contrabass\"}]', '8:20', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Yu-Chung Johnny Ku\"},{\"col1\":\"flute\",\"col2\":\"Chia-Jui He\"},{\"col1\":\"clarinet\",\"col2\":\"Merlin Von Frankenberg\"},{\"col1\":\"bassoon\",\"col2\":\"Yi-chen Chiu\"},{\"col1\":\"horn\",\"col2\":\"Blake Yarbrough\"},{\"col1\":\"trumpet\",\"col2\":\"Shao-Chun Tsai\"},{\"col1\":\"trombone\",\"col2\":\"Kelvin Chan\"},{\"col1\":\"percussion\",\"col2\":\"Wei-Chen Lin and Joseph Van Hassel\"},{\"col1\":\"piano\",\"col2\":\"Yi-Wen Chang\"},{\"col1\":\"violin\",\"col2\":\"Yen-Ting Wu and Chi-fan Tsai\"},{\"col1\":\"violoncello\",\"col2\":\"Yi-Ching Lee\"},{\"col1\":\"contrabass\",\"col2\":\"Briana Goldberg\"}]', '', 'audio', '2006', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-27 15:34:46', '2017-03-11 19:02:55', '6ccaa5e5-a5d5-4137-9e0a-58a2d5e261fc'),
