 ('177', '208', '3', '1', 'en_us', '1', NULL, '{\"authorId\":\"1\",\"title\":\"Ink Painting\",\"slug\":\"ink-painting\",\"postDate\":1377612622,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"205\",\"206\"],\"41\":[\"207\"],\"3\":\"<p>\\r\\n\\tEach single instrument of the quartet represents a basic nature element. first violin is the fire of war (fire), second violin is the wind in forest (wind), viola is the deep ocean (water), and cello is the shifting sands of desert (earth).\\r\\n<\\/p>\",\"8\":\"14:32\",\"7\":[{\"col1\":\"string quartet\"},{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Mark Gibson\"},{\"col1\":\"violin\",\"col2\":\"Gao Can and Kuan Chang Tu\"},{\"col1\":\"viola\",\"col2\":\"Yan-ting Wu\"},{\"col1\":\"cello\",\"col2\":\"Chang Pan\"}],\"10\":\"\",\"14\":\"2011\"}}', '2013-08-27 14:10:23', '2017-03-11 19:02:41', '4bb6a5f1-d671-4a04-8da3-cea159f91657'),
 ('178', '56', '2', '1', 'en_us', '4', NULL, '{\"authorId\":\"1\",\"title\":\"Orchestra\",\"slug\":\"orchestra\",\"postDate\":1377518520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"71\",\"208\"]}}', '2013-08-27 14:10:32', '2017-03-11 19:02:41', '1ec71963-dffb-4845-a4c4-9f13043788eb'),
 ('179', '212', '3', '1', 'en_us', '1', NULL, '{\"authorId\":\"1\",\"title\":\"Tinkly Jade\",\"slug\":\"tinkly-jade\",\"postDate\":1377612856,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"209\",\"210\"],\"41\":[\"211\"],\"3\":\"<p>\\r\\n\\tIn an empty palace that is so quiet, even the tinkling sound of jade hung on concubine\'s belt can be heard easily.\\r\\n<\\/p>\",\"8\":\"10:19\",\"7\":[{\"col1\":\"marimba\"},{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"marimba\",\"col2\":\"Bingye Chen\"},{\"col1\":\"string orchestra\",\"col2\":\"EOS orchestra\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:14:17', '2017-03-11 19:02:41', 'f26b1f6d-e7ef-445f-b918-d265415bb1f8'),
 ('180', '56', '2', '1', 'en_us', '5', NULL, '{\"authorId\":\"1\",\"title\":\"Orchestra\",\"slug\":\"orchestra\",\"postDate\":1377518520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"71\",\"208\",\"212\"]}}', '2013-08-27 14:14:24', '2017-03-11 19:02:41', '9d2e0be6-1694-44d3-8004-f17be0ae98af'),
 ('181', '216', '3', '1', 'en_us', '1', NULL, '{\"authorId\":\"1\",\"title\":\"Ebb and Flow\",\"slug\":\"ebb-and-flow\",\"postDate\":1377613081,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"213\",\"214\"],\"41\":[\"215\"],\"3\":\"<p>\\r\\n\\tEbb and Flow is inspired by the idea of cause and effect. All things, as well as the sections of this work, start with a strike, and followed by series of effects that create different outcomes. These unpredictable results lead this work to conflict or cohesive sections that create emotional tension to propel the music forward.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe piece is constructed around two groups of pitches \\u2013 C, C<sup>#<\\/sup>, D, D<sup>#<\\/sup>, E, and F<sup>#<\\/sup>, G, G<sup>#<\\/sup>, A, B<sup>b<\\/sup>. They start the work together as a whole, and go apart through out the piece in variation. The sets are presented wholly or partially in forms of pillar chords, melodic components, accompanying forces, and harmonic backdrop. Furthermore, the two sets sometimes compete with each other, and sometimes combine to compliment each other.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tF and B, the two among the twelve pitches that are not presented in the main pitch materials, play an insignificant role in the composition. They act as the filling of the twelve-tone-chord sonority, but don\\u2019t draw melodic or thematic attention. It is not until the end, after all instruments reach the climax, that the vibraphone hit these two notes strongly to conclude this piece with a satisfying completion of twelve pitches.\\r\\n<\\/p>\",\"8\":\"10:09\",\"7\":[{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"orchestra\",\"col2\":\"Kiev Philoharmonics\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:18:01', '2017-03-11 19:02:41', '09eeef22-cf96-4806-90c8-932423f3c9ce'),
 ('182', '56', '2', '1', 'en_us', '6', NULL, '{\"authorId\":\"1\",\"title\":\"Orchestra\",\"slug\":\"orchestra\",\"postDate\":1377518520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"71\",\"208\",\"212\",\"216\"]}}', '2013-08-27 14:18:09', '2017-03-11 19:02:41', '72935a1a-2f76-40a8-bcff-5f4c229d7fe5'),
 ('183', '220', '3', '1', 'en_us', '1', NULL, '{\"authorId\":\"1\",\"title\":\"The Four Immeasurable\",\"slug\":\"the-four-immeasurable\",\"postDate\":1377613291,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"218\",\"217\"],\"41\":[\"219\"],\"3\":\"<p>\\r\\n\\tWish everything has happiness and the cause of happiness.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWish everything has no bitterness and away from the cause of bitterness.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWish everything has luck and the cause of luck.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWish everything has no hatry, desire, lust and anger.\\r\\n<\\/p>\",\"8\":\"8:28\",\"7\":[{\"col1\":\"soprano\"},{\"col1\":\"alto\"},{\"col1\":\"tenor\"},{\"col1\":\"bass\"},{\"col1\":\"mixed choir\"},{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jun-Chiang Chiu\"},{\"col1\":\"orchestra\",\"col2\":\"Taipei Philharmonics\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:21:31', '2017-03-11 19:02:41', '2fac8334-25b8-4dec-8a11-0e85bbf9352a'),
