 ('292', '156', '3', '1', 'en_us', '4', NULL, '{\"authorId\":\"1\",\"title\":\"Colors of Clouds-Floating Air\",\"slug\":\"colors-of-clouds-floating-air\",\"postDate\":1377551760,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"415\",\"400\"],\"4\":[\"153\",\"154\"],\"41\":[\"155\"],\"3\":\"<p>\\r\\n\\t \\\"Cloud Colors\\\" contains 12 small piece. Each single pieces represents different atmosphere, the diversity of the colors of clouds, like open 12 doors of 12 moments.<\\/p>\",\"8\":\"0:29\",\"7\":[{\"col1\":\"bassoon\"},{\"col1\":\"2 violins\"},{\"col1\":\"viola\"},{\"col1\":\"cello\"},{\"col1\":\"contrabass\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"bassoon\",\"col2\":\"Christopher Sales\"},{\"col1\":\"violin\",\"col2\":\"Gao Can and Kaun Chang Tu\"},{\"col1\":\"viola\",\"col2\":\"Miks Silis\"},{\"col1\":\"cello\",\"col2\":\"Sunghan Seung\"},{\"col1\":\"contrabass\",\"col2\":\"Maurice Todd\"}],\"12\":[\"176\",\"172\",\"168\",\"164\"],\"10\":\"\",\"14\":\"2000\"}}', '2015-02-09 02:31:44', '2017-03-11 19:02:41', '4a388e72-c5d6-48eb-87cb-39862e70fe08'),
 ('293', '117', '3', '1', 'en_us', '4', NULL, '{\"authorId\":\"1\",\"title\":\"Po\\u00e8mes Fantastiques Mvt.I\",\"slug\":\"poemes-fantastiques-mvt-i\",\"postDate\":1377546480,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"416\"],\"4\":[\"122\",\"120\"],\"41\":[\"126\"],\"3\":\"<p>\\r\\n\\t  Mvt. 1<\\/p><p>\\r\\n\\t  Thirds and minor seconds establish the theme. The composer tries to express tough but still flexible, full of life force. Use pizz. to imitate heartbeats, like pulsation.<\\/p><p>\\r\\n\\t  Mvt. 2<\\/p><p>\\r\\n\\t  The overtone imitates the sound of peaceful whistle. Strength flows out of the inner heart, calmly, and steadily.<\\/p><p>\\r\\n\\t  Mvt. 3<\\/p><p>\\r\\n\\t  Under the tense atmosphere, tempt to find a way out. Step by step, become frantic and crazy. At last, escape from the cage, breath in the air from the sky.<\\/p>\",\"8\":\"5:30\",\"7\":[{\"col1\":\"violin solo\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Chia-lun Chang\"}],\"12\":[\"118\",\"119\"],\"10\":\"\",\"14\":\"2000\"}}', '2015-02-10 05:29:47', '2017-03-11 19:02:41', 'd1646c22-4d67-4fb3-9a19-4ad39fdb1b29'),
