INSERT INTO `craft_matrixcontent_premiers` (`id`, `elementId`, `locale`, `field_premierItem_description`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('1', '347', 'en_us', '<p>\r\n	<cite>“Concerto for Clarinet, Piano and String Orchestra</cite>” was performed in the concert, <cite>“Works by Composition Students”</cite> in Taipei National University of the Arts. (TNUA)</p>', '2015-02-01 00:08:28', '2017-03-11 19:02:58', 'c13b3e16-a912-48a4-aada-ca97a76347d1'),
 ('2', '348', 'en_us', '<p>\r\n	Joined in the workshop held by Ensemble Modern and string quartet \r\n	<cite>“Mei, Len-Fang”</cite> were played by them. <cite>“Mei, Len-Fang”</cite> and <cite>“5 Pieces for piano”</cite> were performed in the concert <cite>“Composition Concert”</cite> in TNUA.</p>', '2015-02-01 00:22:57', '2017-03-11 19:02:58', 'db486eef-ad21-4b47-8132-3bc3787854e9'),
 ('3', '349', 'en_us', '<p>\r\n	Held a personal recital in the Performance Art Center in TNUA composed back ground music for a short film concerto for violin and orchestra, <cite>“Deep”</cite> was in the final contest of 2004 Formosa Competition held by Council for Cultural Affairs, and was performed in Taipei National Music Hall.</p>', '2015-02-01 00:28:21', '2017-03-11 19:02:59', '3832fb07-3b6d-44aa-ba63-ecb5eb62ac3e'),
 ('4', '350', 'en_us', '<p>In 2005, <cite>”Poémes Fantastiques”</cite> for violin was performed in the Composition Recital of University of Cincinnati, College, Conservatory of Music(CCM).</p>', '2015-02-01 00:32:35', '2017-03-11 19:02:59', '07790e54-8a78-43e5-92c3-bb558e52d5cb'),
 ('5', '351', 'en_us', '<p>In 2006, <cite>“Ebb and Flow”</cite> for orchestra won the ERM Media’s competition, and was recorded by Kiev Philharmonic Orchestra.</p>', '2015-02-01 00:34:26', '2017-03-11 19:02:59', '628cdb63-17dd-4c76-b7ce-b9e271bc4567'),
 ('6', '352', 'en_us', '<p>\r\n	In 2007, held a recital in CCM’s Werner recital hall String Quartet, <cite>”Mei. Lang-Fang”</cite> was performed in new music festival Music07.</p>', '2015-02-01 00:37:27', '2017-03-11 19:02:59', 'a16efd31-56db-48b5-9e3d-d6d8d8999de2'),
 ('7', '353', 'en_us', '<p>\r\n	Won the orchestral competition of CCM, and got commissioned to complete violin concerto, <cite>”Deep”</cite>s all four movements.</p>', '2015-02-01 00:38:20', '2017-03-11 19:02:59', '01d9c207-fb06-4949-9d3b-96780c6e5413'),
 ('8', '354', 'en_us', '<p>In 2008, Chamber music <cite>“Image, Mirage”</cite> was performed in University of Iowa.</p>', '2015-02-01 00:40:38', '2017-03-11 19:02:59', '27f8e184-9290-4859-81b0-98fa10b49041'),
 ('9', '355', 'en_us', '<p><cite>“Lost Time II-Shifting Sands……”</cite> and in the Concert of music organization Mus21 in University of Cincinnati, TUC’s Great Hall on May 11<sup>th</sup> 2008.</p>', '2015-02-01 00:43:02', '2017-03-11 19:02:59', '389a5446-c40a-4bf9-a38e-56a2af23a0fe'),
 ('10', '356', 'en_us', '<p>Choral work, <cite>“Yu Ge Tzi”</cite> was performed by Ming-De choir in Philadelphia.</p>', '2015-02-01 00:45:14', '2017-03-11 19:02:59', '4e7febc6-eb6c-449e-9a66-894e71f5c622'),
 ('11', '357', 'en_us', '<p>Chamber music <cite>“Cloud Colors”</cite> was performed in Atrium Concert of CCM.</p>', '2015-02-01 00:45:14', '2017-03-11 19:02:59', '13b5543d-3cd1-46b3-b186-97784a37cfa0'),
 ('12', '358', 'en_us', '<p>Violin concerto, <cite>“Deep”</cite> was performed by CCM’s orchestra on Feb 25<sup>th</sup>.</p>', '2015-02-01 00:48:09', '2017-03-11 19:02:59', '7d9d8dbd-f92b-441e-bf12-7b6ce538c9ed'),
 ('13', '359', 'en_us', '<p><cite>“Pounding of Life”</cite> for piano and 2 percussionists, and the piece was performed at Weil Recital Hall of Carnegie Hall on May 1<sup>st</sup>.</p>', '2015-02-01 00:50:21', '2017-03-11 19:02:59', '458ddef5-37f0-4c88-97e5-b34f965b0110'),
 ('14', '360', 'en_us', '<p><cite>“Rustling Leaves”</cite> for violin and viola was performed in Mid West Composers’ Forum in University of Michigan.</p>', '2015-02-01 00:50:21', '2017-03-11 19:02:59', 'c3169fec-da55-4df2-9670-6247c534beb3'),
