 ('73', 'field', '3', 'en_us', ' the perception of achieving the concept of leaving blank for imagination to run without having the standard traditional chinese music s hetrophony is the main topic of this work performance review the other premiere played by all four musicians was contemporary composer chen hsin lei s by the light of nature a musical realization of the concept of nothingness or blankness described in the notes as one of the spiritual cores of chinese art to give you a partial idea of that concept imagine something that is hidden from you like a village that you can t see because there s a mountain in front of it this most impressive work included some apparently pre recorded digital sounds thus it interrupt performers sense of coordination to count together performers can grad a hint or find their own clue of tempo from the tape part instruments are the color linearly each instrument has limited freedom of it s own pulse their unique timbre gives diversity of texture however there are points they meet up together to create tension and resolve each single one of them has its sound world yet together they are one work in harmony a pleasing state of agreement or orderly combination of elements in a whole '),
