 ('228', 'field', '3', 'en_us', ' maestro hu yongyen told me hsin lei give me wagner we want wagner and i though it s about time to go back to german style this piece is inspired by wagner s valkyrie and quoted many leitmotivs wagner s aesthetics to war violence destroy and the pleasant comes afterwards are too excitingly brutal for me to accept there is no fatherly kind reliable and warm spirit in the opera it s restless it s reality it s way too close to us after being through the delicatly processed agony and force here comes the hope and eager for piece beethoven s motive orchestration phrasing and chord is the foundation of this piece if wagner is the deep ocean that can swallow and destroy everything beethoven is the broad sea that give the world life with beethoven s spirit there is courage to floor in the waves of thunderstorm this piece is about struggling struggle in between hope and desperation against lust and desire like black hole of humanity and yet after everything have been through still peruse the brightness the reflection of sun the light of the promise land '),
